  [],\n\t\"revision_timestamp\": \"2016-09-03T10:16:12.507962\",\n\t\"name\": \"cdc-wonder-daily-fine-particulate-matter\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"<p>The Daily Fine Particulate Matter data
  available on CDC WONDER are geographically aggregated daily measures of fine particulate
  matter in the outdoor air, spanning the years 2003-2008. PM2.5 particles are air
  pollutants with an aerodynamic diameter less than 2.5 micrometers. Reported measures
  are the daily measure of fine particulate matter in micrograms per cubic meter (PM2.5)
  (''u00c2u00b5g/m''u00c2u00b3), the number of observations, minimum and maximum range
  value, and standard deviation. Data are available by place (combined 48 contiguous
  states plus the District of Columbia, region, division, state, county), time (year,
  month, day) and specified fine particulate matter (''u00c2u00b5g/m''u00c2u00b3)value.
  County-level and higher data are aggregated from 10 kilometer square spatial resolution
  grids. In a study funded by the NASA Applied Sciences Program / Public Health Program,
  scientists at NASA Marshall Space Flight Center / Universities Space Research Association
  modified the regional surfacing algorithm of Al-Hamdan et al. (2009) and used it
  to generate continuous spatial surfaces (grids) of daily PM2.5 for the whole conterminous
  U.S. for 2003-2008. Two sources of environmental data were used as input to the
  surfacing algorithm, US Environmental Protection Agency (EPA) Air Quality System
  (AQS) PM2.5 in-situ data and National Aeronautics and Space Administration (NASA)
  Moderate Resolution Imaging Spectroradiometer (MODIS) aerosol optical depth remotely
  sensed data. They also identified in a Geographic Information System (GIS) the associated
  geographic locations of the centroids of the gridded PM2.5 dataset in terms of the
  counties and states they fall into to enable aggregation to different geographic
  levels in CDC WONDER.</p>n\",\n\t\"license_title\": \"Other License Specified\",\n\t\"extras\":
